import { Component } from "react";

const styles = {
  carro: {
    backgroundColor: "#359A2C",
    color: "#fff",
    border: 'none',
    padding: '10px',
    borderRadius: "5px",
    cursor: 'pointer',
  },
};

class Carro extends Component {
  render() {
    return (
      <div>
        <span style={styles.bubble}>
            <BubbleAlert/>
        </span>
        <button style={styles.carro}>Carro</button>
      </div>
    );
  }
}

export default Carro;
